import React from 'react';
import './App.css';
import Members from './Component/Members/Members';

class App extends React.Component{
  constructor(){
    super();
    this.state={
      opnDesk: false
    }
    this.toggleDesk = this.toggleDesk.bind(this);
  }

  toggleDesk(){
    this.setState({
      opnDesk:true
    });
  }

  render(){
    return (
      <div className="App">
        <Members/>
        <button onClick={this.toggleDesk}>Show Desktop</button>
      </div>
    );
  }
}

export default App;
